import { useState } from 'react'
import SelectionSequence from './SelectionSequence';


function Home(){

    const [getStarted, setGetStarted] = useState(false);

    return(
        <div>
            <h1 className='heading'>Welcome to MovAI!</h1>

            { (!getStarted) && <button className='get-started' onClick={setGetStarted(true)}>Get Started!</button> }

            { (getStarted) && <SelectionSequence/> }
            
        </div>
    );

}

export default Home;
